import React from 'react'
import { Link as RouterLink } from "react-router-dom";
import { AppBar, Toolbar, Button, Drawer} from "@material-ui/core";
import { headerData } from '../data/HeaderData'
import "./style.css" 

const getNavButton = () => {

    return headerData.map(({ label, href }) => {
        return (
        <Button
            {...{
            key: label,
            color: "inherit",
            to: href,
            component: RouterLink,
            }}
        >
            {label}
        </Button>
        );
    });

};


export default function Header() {
    const [state, setState] = React.useState({
        top: false,
        left: false,
        bottom: false,
        right: false,
      });

    const toggleDrawer = (anchor, open) => (event) => {
    if (event.type === 'keydown' && (event.key === 'Tab' || event.key === 'Shift')) {
        return;
    }

    setState({ ...state, [anchor]: open });
    };


    const Nav = () => {
        return (
        <Toolbar>
            <Button onClick={toggleDrawer("left", true)}>Left Menu Navigator</Button>
            <Drawer anchor="left" onClose={toggleDrawer("left", false)}>
            {}
            </Drawer>
            {getNavButton()}
        </Toolbar>)
    };

    return (
        <header>
          <AppBar className="header">{Nav()}</AppBar>
        </header>
      );

}
